import React, { Component } from "react";

class Experience extends Component{
    render () {
        return(
            <section id='experience'>
                <h1>Here's What I've Done...so far!</h1>

                <h2>Software Based</h2>
                <h3>This Website</h3>
                <h3>Front Page of Autocad</h3>
                <h3>Final Project</h3>

                <h2>Other</h2>
                <h3>Paper 1</h3>
                <h3>Paper 2</h3>
                <h3>Research</h3>
            </section>
        );
    }
}

export default Experience;
